import React  from 'react';
import './App.css';
import Home from './Home';
import Navbar from './Navbar';
import {BrowserRouter as Router,Route,Routes } from 'react-router-dom';


function App() {
  return (

    <>   
    <h1>App page</h1>
    <Navbar />
     <Router>

<Routes>     

      <Route exact path="/Home" element={<Home/>}/>  
    </Routes>
  </Router>
  </>

  );
}

export default App;
